import { StrictMode } from "react";
import { createRoot } from "react-dom/client";

// import App from "./App";

function App() {
  return (
    <News>
      <Title> title="the daily schoop" </Title>
      <Story
        image="https://placehold.co/600x400"
        title="Tesla recall for heater and
        defroster systems issued by Transport Canada"
        author="By: Maria Merano"
        description="Transport Canada issued a recall for the Tesla Model 3,
        Model Y, and Model S on February 3, 2022, the agency told Teslarati
        recently."
        link="https://www.teslarati.com/tesla-recall-heater-defroster-system-transport-canada/"
      />
      <Story
        image="https://placehold.co/600x400"
        title="Tesla recall for heater and
        defroster systems issued by Transport Canada"
        author="By: Maria Merano"
        description="Transport Canada issued a recall for the Tesla Model 3,
        Model Y, and Model S on February 3, 2022, the agency told Teslarati
        recently."
        link="https://www.teslarati.com/tesla-recall-heater-defroster-system-transport-canada/"
      />
    </News>
  );
}

function News(props) {
  return (
    <div className="newsContainer">
      <div className="title">
        <h1>The daily schoop</h1>
      </div>
    </div>
  );
}

function Title(props) {
  return <div className="newsSiteTitle">{props.title}</div>;

}

function Story(props) {
  let image;

  if (!props.image) {
    image = "https://placehold.co/600x400";
  } else {
    image = props.image;
  }
  return (
    <div>
      <img className="image" src="{image}" alt="" />
      <a href={props.link}>
        <img src={image} alt="" />
      </a>
    </div>
  );
}

const rootElement = document.getElementById("root");
const root = createRoot(rootElement);

root.render(
  <StrictMode>
    <App />
  </StrictMode>
);
